	 function [H,P0,P1,P2,P3,P4] = LTH_BAND_14_14_H(x, ewT, eLwT)	 	 % Function for Example 14.14	 	 % 	Toolbox for DIGITAL FILTERS USING MATLAB 	 	 % 	Author: 		Lars Wanhammar 2011-02-11	 % 	Modified by: 	 	 % 	Copyright:		by authors - not released for commercial use	 % 	Version:		1	 % 	Known bugs:		 	 % 	Report bugs to:	Wanhammar@gmail.com	 	 P0 = (1-x(1)*eLwT).*(1-x(2)*eLwT).*(1-x(3)*eLwT)./((eLwT-x(1)).*(eLwT-x(2)).*(eLwT-x(3)));	 P1 = (1-x(4)*eLwT).*(1-x(5)*eLwT)./((eLwT-x(4)).*(eLwT-x(5)))./ewT;	 P2 = (1-x(6)*eLwT).*(1-x(7)*eLwT)./((eLwT-x(6)).*(eLwT-x(7)))./ewT.^2;	 P3 = (1-x(8)*eLwT).*(1-x(9)*eLwT)./((eLwT-x(8)).*(eLwT-x(9)))./ewT.^3;	 P4 = (1-x(10)*eLwT).*(1-x(11)*eLwT)./((eLwT-x(10)).*(eLwT-x(11)))./ewT.^4;	 H = (P0+P1+P2+P3+P4)/5;	 	 